            static GTypeInfo info = {
            TTTClass.sizeof,
            null,   /* base_init */
            null,   /* base_finalize */
            cast(GClassInitFunc)&(TTTClass.init),   /* class_init */
            null,   /* class_finalize */
            null,   /* class_data */
            TTT.sizeof,
            0,      /* n_preallocs */
            null    /* instance_init */
            };
            type = Type.registerStatic(GType.OBJECT,
                                            TTT.stringof,
                                            &info, cast(GTypeFlags) 0);
        }
        return type;
    }   
}



}

int main(string[] args)
{
    Main.init(args);
    auto t = TTT.ttt_get_type();
    Type.createInstance(t);

